import React from "react";

const Bonbon = () => {
  return (
    <div>
      <img
        src="./bonbon.jpg"
        alt="haribo"
        style={{ width: "40%", borderRadius: "5%" }}
      ></img>
    </div>
  );
};

export default Bonbon;
